function Footer() {
  return (
    <div className='mv__logoSliderWrap'>
      <div className='mv__logoSliderWrap'>
        <div className='mv__logoSlider'></div>
      </div>
      <div className='note'>
        <p className='mv__logoSliderAnnotation'>
          * Bao gồm một số công ty đã giới thiệu
        </p>
      </div>
    </div>
  );
}
export default Footer;
